'use strict'
class LiteBokz {
    constructor() {
        this.settings = {}
        addEventListener('DOMContentLoaded', () => {
            this.load()
        })
    }

    resize() {
        this.scale = innerHeight
    }

    load() {
        this.scale = 1
        addEventListener('resize', () => this.resize())
        this.resize()

        // Revert to default settings if not declared
        if (!this.themes) this.themes = [
            {
                hue: 220,
                saturate: 20,
                light: 13,
                alpha: .7
            },{
                hue: 220,
                saturate: 20,
                light: 100,
                alpha: .7
            }
        ]

        if (!this.tools) this.tools = ['out', 'in', 'theme', 'download', 'fit', 'full', 'exit']

        const settings = {
            blurOnExit: false,
            gestureToZoom: true,
            swipeToSwitchPC: true,
            swipeToSwitchMobile: true,
            swipeSensitivityPC: 10,
            swipeSensitivityMobile: 5,
            swipeRangePC: .5,
            swipeRangeMobile: .5,
            swipeResistancePC: .4,
            swipeResistanceMobile: 1,
            hasFooter: true,
            hasWordmark: true,
            tapToHidePanels: false,
            tapAwayToClose: false,
            zoomIncrement: .15,
            zoomSpeed: .8,
            zoomMax: 15,
            zoomMin: 1,
            renderPixelated: 700,
        }

        for (const [key, value] of Object.entries(settings)) {
            if (this.settings[key] == undefined) {
                this.settings[key] = value
            }
        }

        this.isMobile = 'ontouchstart' in window || navigator.maxTouchPoints > 0

        const s = this.settings
        const m = this.isMobile

        if (s.swipeToSwitch == null) s.swipeToSwitch = (m ? s.swipeToSwitchMobile : s.swipeToSwitchPC)
        if (s.swipeSensitivity == null) s.swipeSensitivity = (m ? s.swipeSensitivityMobile : s.swipeSensitivityPC)
        if (s.swipeRange == null) s.swipeRange = (m ? s.swipeRangeMobile : s.swipeRangePC)
        if (s.swipeResistance == null) s.swipeResistance = (m ? s.swipeResistanceMobile : s.swipeResistancePC)

        /* Work Sans */
        this.font = {
            base64: '',
            format: 'truetype',
            mime: 'font/ttf'
        }

        this.fullIcon = 'M 1 1.3 L 1 1 L 1.3 1 M 1.7 1 L 2 1 L 2 1.3 M 2 1.7 L 2 2 L 1.7 2 M 1.3 2 L 1 2 L 1 1.7'
        this.minIcon = 'M 1 1 L 1.3 1.3 M 1.3 1 L 1.3 1.3 L 1 1.3 M 1 2 L 1.3 1.7 M 1 1.7 L 1.3 1.7 L 1.3 2 M 2 2 L 1.7 1.7 M 1.7 2 L 1.7 1.7 L 2 1.7 M 2 1 L 1.7 1.3 M 1.7 1 L 1.7 1.3 L 2 1.3'

        this.toolIcons = {
            out: `<button class="litebokz-button" id="litebokz-minus" title="zoom out">
                <div class = "litebokz-button-main">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                        <path d="M 1.1 1.5 L 1.9 1.5" stroke="#000" stroke-width=".1" fill="none"/>
                    </svg>
                </div>
            </button>`,
            in: `<button class="litebokz-button" id="litebokz-plus" title="zoom in">
                <div class = "litebokz-button-main">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                        <path d="M 1.5 1.9 L 1.5 1.1 M 1.1 1.5 L 1.9 1.5" stroke="#000" stroke-width=".1" fill="none"/>
                    </svg>
                </div>
            </button>`,
            theme: `<button class="litebokz-button" id="litebokz-theme" title="change theme">
                <div class = "litebokz-button-main">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                        <path d="M 1.3 1 A 0.1 0.1 0 0 0 1.8 1.9 C 1.89 1.84 1.94 1.79 2 1.7 C 1.68 1.85 1.16 1.4 1.3 1" stroke="#000" stroke-width=".1" fill="none"/>
                    </svg>
                </div>
            </button>`,
            download: `<button class="litebokz-button" id="litebokz-download" title="download image">
                <div class = "litebokz-button-main">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                        <path d="M 1 1.7 L 1 2 L 2 2 L 2 1.7 M 1.5 1 L 1.5 1.7 M 1.2 1.4 L 1.5 1.7 L 1.8 1.4" stroke="#000" stroke-width=".15" fill="none"/>
                    </svg>
                </div>
            </button>`,
            fit: `<button class="litebokz-button" id="litebokz-fit" title="fit to screen">
                <div class = "litebokz-button-main">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                        <path d="M 1 2 L 1 1 L 2 1 L 2 2 Z M 1.3 1.6 L 1.3 1.3 L 1.6 1.3 M 1.7 1.7 L 1.3 1.3" stroke="#000" stroke-width=".1" fill="none"/>
                    </svg>
                </div>
            </button>`,
            full: `<button class="litebokz-button" id="litebokz-fullscreen" title="fullscreen mode">
                <div class = "litebokz-button-main">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                        <path id = "litebokz-fullscreen-path" d="${this.fullIcon}" stroke="#000" stroke-width=".1" fill="none"/>
                    </svg>
                </div>
            </button>`,
            exit: `<button class="litebokz-button" id="litebokz-close" title="exit">
                <div class = "litebokz-button-main">
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                        <path d="M 1.1 1.1 L 1.9 1.9 M 1.1 1.9 L 1.9 1.1" stroke="#000" stroke-width=".1" fill="none"/>
                    </svg>
                </div>
            </button>`
        }

        this.active = false

        this.zoomAmt = 1
        this.zoomSmooth = 0
        this.camX = 0
        this.camY = 0

        this.nameSections = {}
        this.nameDuds = []

        this.panelVisible = false
        this.placeholder = 'https://sites.joachimford.uk/litebokz.jpg'

        this.init()
    }

    makeThemeStart(i) {
        return 'theme-' + i
    }

    themeOnChange() {
        // Users can change their code when theme is toggled
    }

    setTheme(idx) {
        const lastClass = this.makeThemeStart(this.selectedTheme)
        this.holder.classList.remove(lastClass)

        this.selectedTheme = idx % this.themes.length
        this.holder.classList.add(this.makeThemeStart(this.selectedTheme))

        this.themeOnChange()
    }

    errorCheck() {
        // Arrays
        if (this.tools.constructor != Array) return 'tools must be an array'
        if (this.tools.some(e => typeof e != 'string')) return 'tools[] most contain only strings'
        if (this.tools.some(e => !this.toolIcons[e])) return 'tools[] references a nonexistent button'

        // Colors
        for (let i = 0; i < this.themes.length; i ++) {
            const col = this.themes[i]
            if (typeof col.hue != 'number') return `theme ${i}: hue must be a number`
            if (typeof col.saturate != 'number') return `theme ${i}: saturate must be a number`
            if (typeof col.light != 'number') return `theme ${i}: light must be a number`
            if (typeof col.alpha != 'number') return `theme ${i}: alpha must be a number`
        }

        // Settings
        const num = key => {if (typeof this.settings['key'] != 'number') return key + ' must be a number'}

        num('swipeSensitivity')
        if (this.settings.swipeSensitivity <= 0) return 'swipeSensitivity must be a positive number'
        num('swipeSensitivityPC')
        if (this.settings.swipeSensitivityPC <= 0) return 'swipeSensitivityPC must be a positive number'
        num('swipeSensitivityMobile')
        if (this.settings.swipeSensitivityMobile <= 0) return 'swipeSensitivityMobile must be a positive number'

        num('swipeRange')
        if (this.settings.swipeRange <= 0) return 'swipeRange must be a positive number'
        num('swipeRangePC')
        if (this.settings.swipeRangePC <= 0) return 'swipeRangePC must be a positive number'
        num('swipeRangeMobile')
        if (this.settings.swipeRangeMobile <= 0) return 'swipeRangeMobile must be a positive number'

        num('swipeResistance')
        if (this.settings.swipeResistance <= 0) return 'swipeResistance must be a positive number'
        num('swipeRangePC')
        if (this.settings.swipeResistancePC <= 0) return 'swipeResistancePC must be a positive number'
        num('swipeRangeMobile')
        if (this.settings.swipeResistanceMobile <= 0) return 'swipeResistanceMobile must be a positive number'

        num('zoomIncrement')
        if (this.settings.zoomIncrement < 0) return 'zoomIncrement must be a positibe number'

        num('zoomSpeed')
        num('zoomMin')
        num('zoomMax')
        
        if (this.settings.zoomMax < this.settings.zoomMin) return 'zoomMax must be greater than zoomMin'
        if (this.settings.zoomMin > this.settings.zoomMax) return 'zoomMin must be greater than zoomMax'

        if (this.settings.zoomMin < 0) return 'zoomMin must be a positive number'

        num('renderPixelated')
        if (this.settings.renderPixelated < 0) return 'renderPixelated must greater than zero'
    }

    init() {
        if (this.errorCheck())
            return console.error(this.errorCheck())

        this.findImages()
        this.generate()
        this.setTheme(0)

        this.generateListeners()

        this.updateDisplay()
    }

    mod(x, cap) {
        return (((x % cap) + cap) % cap)
    }

    generateListeners() {
        // --- Detect zoom ---
        this.shadow.addEventListener('wheel', e => this.zoom(e), {passive: false})

        // --- Detect dragging ---
        let mouseDown = false
        let startX = 0
        let startY = 0

        // Swiping images
        let isSwiping = null
        let swipeComplete = false
        let swipeX = 0

        const isFitted = () => this.zoomAmt == 1 &&
            !this.roundToDec(this.camX, 2) &&
            !this.roundToDec(this.camY, 2)

        const swipe = () => {
            const SWIPE_COMPLETE = 1.3
            const SWIPE_RESET = .7
            const SWIPE_BUFFER = .2
            const SWIPE_BUFFER_RESET = .7

            let swipeBuffer = swipeX

            let buffer = false
            if ((swipeX > 0 && !this.leftGoalImg) ||
                (swipeX < 0 && !this.rightGoalImg)) {

                swipeBuffer *= SWIPE_BUFFER
                if (!mouseDown) swipeX *= SWIPE_BUFFER_RESET

                buffer = true
            }
            else swipeBuffer *= this.settings.swipeResistance

            this.image.style.opacity = 1 - (Math.abs(swipeBuffer) / innerWidth)
            this.image.style.transform = `translate(calc(-50% + ${swipeBuffer}px), -50%)`
            this.image.style.transition = '0s'

            const box = this.image.getBoundingClientRect()
            const onScreen = box.left < innerWidth && box.right > 0

            if (!mouseDown && !buffer) {
                if (swipeComplete) {
                    swipeX *= SWIPE_COMPLETE

                    if (!onScreen) {
                        if (box.left > innerWidth) this.image.classList.add('right')
                        if (box.right < 0) this.image.classList.add('left')

                        this.image.style.opacity = ''
                        this.image.style.transform = ''

                        const img = this.image
                        requestAnimationFrame(() => img.style.transition = '')

                        if (box.left >= innerWidth) {
                            this.image = this.leftTemplateImg
                            this.image.style.opacity = ''
                            this.image.style.transform = ''
                            this.image.style.transition = ''
                            this.selectImage(this.leftGoalImg)
                        }

                        if (box.right <= 0) {
                            this.image = this.rightTemplateImg
                            this.image.style.opacity = ''
                            this.image.style.transform = ''
                            this.image.style.transition = ''
                            this.selectImage(this.rightGoalImg)
                        }

                        swipeComplete = false
                    }
                }

                else swipeX *= SWIPE_RESET
            }

            if (Math.abs(swipeX) > .01 && onScreen)
                isSwiping = requestAnimationFrame(swipe)

            else {
                isSwiping = null
                this.image.style.opacity = ''
                this.image.style.transform = ''
                this.image.style.transition = ''
            }
        }

        this.mouseDown(this.displayHold, e => {
            mouseDown = true
            startX = e.clientX
            startY = e.clientY
        })
        this.mouseMove(this.displayHold, e => {
            if (!mouseDown)
                return

            const x = e.clientX
            const y = e.clientY

            const vx = (x - startX)
            const vy = (y - startY)

            this.camX += vx
            this.camY += vy

            this.updateDisplay()

            if (isFitted() && this.settings.swipeToSwitch) {
                swipeX = vx
                if (isSwiping == null) swipe()
            }

            else {
                startX = e.clientX
                startY = e.clientY
            }
        })
        this.mouseUp(window, e => {
            mouseDown = false

            // Decide if we should switch
            if (isSwiping) {
                const VELOCITY_IMPACT = this.settings.swipeSensitivity
                const SWITCH_THRESHOLD = this.settings.swipeRange

                const box = this.image.getBoundingClientRect()
                const boxX = (box.x + box.width / 2) + swipeX * VELOCITY_IMPACT

                if (Math.abs(boxX - innerWidth / 2) > innerWidth * SWITCH_THRESHOLD)
                    swipeComplete = true
                else swipeComplete = false
            }
        })
    }

    click = (el, cb = () => {}) => {
        if (!el) return
        const ev =
            'onpointerdown' in window ? 'pointerdown' :
            'ontouchstart' in window ? 'touchstart' :
            'onmousedown' in window ? 'mousedown' :
            'click'
        el.addEventListener(ev, cb)
    }
    clickOverride = (el, cb = () => {}) => {
        if (!el) return
        if ('onpointerdown' in window) el.onpointerdown = cb
        else if ('ontouchstart' in window) el.ontouchstart = cb
        else if ('onmousedown' in window) el.onmousedown = cb
        else el.onclick = cb
    }

    mouseDown = (el, cb = () => {}) => {
        if (!el) return
        const ev =
            'onpointerdown' in window ? 'pointerdown' :
            'ontouchstart' in window ? 'touchstart' :
            'mousedown'
        el.addEventListener(ev, cb)
    }
    mouseMove = (el, cb = () => {}) => {
        if (!el) return
        const ev =
            'onpointermove' in window ? 'pointermove' :
            'ontouchmove' in window ? 'touchmove' :
            'mousemove'
        el.addEventListener(ev, cb)
    }
    mouseUp = (el, cb = () => {}) => {
        if (!el) return
        const ev =
            'onpointerup' in window ? 'pointerup' :
            'ontouchend' in window ? 'touchend' :
            'mouseup'
        el.addEventListener(ev, cb)
    }

    roundToDec(number, dp) {
        const factor = 10 ** dp
        return Math.round(number * factor) / factor
    }

    capZoom(zoom) {
        return Math.max(this.settings.zoomMin, Math.min(this.settings.zoomMax, zoom))
    }

    updateDisplay(factor = null) {
        this.zoomAmt = this.capZoom(this.zoomAmt)

        // --- Cap camera position ---
        const box = this.image.getBoundingClientRect()
        const fact = factor || 1
        const w = box.width / 2 * fact
        const h = box.height / 2 * fact

        const stickiness = 1

        const extraW = w * stickiness / Math.max(this.zoomAmt, 1)
        const extraH = h * stickiness / Math.max(this.zoomAmt, 1)

        if (this.camX > w - extraW) this.camX = w - extraW
        if (this.camX < -w + extraW) this.camX = -w + extraW
        if (this.camY > h - extraH) this.camY = h - extraH
        if (this.camY < -h + extraH) this.camY = -h + extraH

        // --- Toggle controls ---
        if (this.minusBtn) {
            this.minusBtn.classList.remove('disable')

            if (this.zoomAmt <= this.settings.zoomMin)
                this.minusBtn.classList.add('disable')
        }
        if (this.plusBtn) {
            this.plusBtn.classList.remove('disable')

            if (this.zoomAmt >= this.settings.zoomMax)
                this.plusBtn.classList.add('disable')
        }
        if (this.fitBtn) {
            this.fitBtn.classList.remove('disable')

            if (this.zoomAmt == 1 &&
                !this.roundToDec(this.camX, 2) &&
                !this.roundToDec(this.camY, 2))
                this.fitBtn.classList.add('disable')
        }

        // --- Apply transforms ---
        this.imageHolder.style.transform = `
            translate(
                ${this.camX}px,
                ${this.camY}px)
            scale(${this.zoomAmt})`
    }

    zoom(e) {
        if (e.ctrlKey) e.preventDefault()
        if (!this.imageHolder || !this.image) return

        const box = this.displayHold.getBoundingClientRect()
        const imgCenterPx = box.y + box.height / 2
        const imgCenterDis = imgCenterPx - (innerHeight / 2)
        const imgCenter = .5 + (imgCenterDis / innerHeight)

        // --- Calculate zooming ---
        const zoomSpeed = this.settings.zoomSpeed / this.scale
        const zoomDelta = -e.deltaY * zoomSpeed

        const oldZoom = this.zoomAmt
        let newZoom = this.zoomAmt + this.zoomAmt * zoomDelta
        newZoom = this.capZoom(newZoom)
        if (newZoom == oldZoom) {
            this.updateDisplay()
            return
        }

        // --- Calculate panning ---
        const x = e.clientX
        const y = e.clientY
        const w = innerWidth
        const h = innerHeight

        const mouseX = (x / w) - .5
        const mouseY = ((y / h) - imgCenter)

        const worldX = mouseX * innerWidth
        const worldY = mouseY * innerHeight

        /* For center zoom, do cam * factor */
        const zoomFactor = newZoom / oldZoom
        this.camX = worldX - (worldX - this.camX) * zoomFactor
        this.camY = worldY - (worldY - this.camY) * zoomFactor

        this.zoomAmt = newZoom
        this.updateDisplay(zoomFactor)
    }

    open() {
        if (!this.holder) return
        document.documentElement.style.overflow = 'hidden'

        this.holder.classList.add('litebokz-open')

        this.zoomAmt = 1
        this.camX = 0
        this.camY = 0

        this.togglePanels(true)
        this.updateDisplay()
    }

    close() {
        if (!this.holder) return
        document.documentElement.style.overflow = 'auto'

        this.holder.classList.remove('litebokz-open')

        this.toggleFullscreen(false)
        this.togglePanels(false)
    }

    loadImage(template, goal) {
        if (goal) {
            template.src = goal.src
            template.dataset.lbName = goal.dataset.lbName || ''
        }
        else {
            template.src = this.placeholder
            template.dataset.lbName = ''
        }

        template.onload = () => {
            // Render pixelated if small enough
            template.classList.remove('crisp')
            if (template.naturalWidth + template.naturalHeight < this.settings.renderPixelated * 2)
                template.classList.add('crisp')

            // Scale image to always display on big screens
            template.ratio = template.naturalWidth / template.naturalHeight
            template.style.aspectRatio = template.ratio

            if (template._litebokzResize) removeEventListener('resize', template._litebokzResize)
            template._litebokzResize = () => {
                const box = this.display.getBoundingClientRect()
                const screenRatio = box.width / box.height
                if (screenRatio >= template.ratio) {
                    template.style.width = 'auto'
                    template.style.height = (innerWidth / template.ratio) + 'px'
                }
                else {
                    template.style.width = (innerHeight * template.ratio) + 'px'
                    template.style.height = 'auto'
                }
            }
            addEventListener('resize', template._litebokzResize)
            template._litebokzResize()
        }
    }

    selectImage(img) {
        if (!this.image) return

        // Update image
        this.image.classList.remove('left', 'right')
        this.loadImage(this.image, img)
        this.text.innerText = img.dataset.lbAlt != undefined ? img.dataset.lbAlt : img.alt || ''

        // -- Find category & toggle arrows --
        const categoryName = img.dataset.lbName || ''
        const section = categoryName ? this.nameSections[categoryName] : this.nameDuds
        const index = section.indexOf(img)

        // Detect left & right images in advance
        this.leftGoalImg = section[index-1]
        this.leftTemplateImg = this['image'+(this.mod(this.image.litebokzID-2,3)+1)]

        this.rightGoalImg = section[index+1]
        this.rightTemplateImg = this['image'+(this.mod(this.image.litebokzID,3)+1)]

        this.leftTemplateImg.classList.remove('right')
        this.leftTemplateImg.classList.add('left')
        this.loadImage(this.leftTemplateImg, this.leftGoalImg)

        this.rightTemplateImg.classList.remove('left')
        this.rightTemplateImg.classList.add('right')
        this.loadImage(this.rightTemplateImg, this.rightGoalImg)

        if (index > 0) {
            this.navLeft.classList.remove('hidden')
            this.clickOverride(this.navLeft, () => {
                this.image.classList.add('right')
                this.image = this.leftTemplateImg
                this.selectImage(this.leftGoalImg)
            })
        }
        else {
            this.navLeft.classList.add('hidden')
            this.clickOverride(this.navLeft, () => {})
        }

        if (index < section.length - 1) {
            this.navRight.classList.remove('hidden')
            this.clickOverride(this.navRight, () => {
                this.image.classList.add('left')
                this.image = this.rightTemplateImg
                this.selectImage(this.rightGoalImg)
            })
        }
        else {
            this.navRight.classList.add('hidden')
            this.clickOverride(this.navRight, () => {})
        }
    }

    toggleOpen(force = undefined) {
        if (force != undefined) this.active = force
        else this.active = !this.active

        if (this.active) this.open()
        else this.close()
    }

    toggleFullscreen(force = undefined) {
        if (document.fullscreenElement) {
            document.exitFullscreen()
            return false
        }
        if (force == false) return false

        document.documentElement.requestFullscreen()
        return true
    }

    togglePanels(force = undefined) {
        if (force != undefined) this.panelVisible = force
        else this.panelVisible = this.panelVisible = !this.panelVisible

        this.header.classList.toggle('litebokz-panel-hidden', !this.panelVisible)
        this.footer.classList.toggle('litebokz-panel-hidden', !this.panelVisible)
    }

    // Look at all images
    findImages() {
        const loadImages = (main) => {
            const newImage = () => {
                const image = new Image()
                image.src = main.dataset.lbImage
                Object.assign(image.dataset, main.dataset)
                return image
            }

            let img = (
                main.dataset.lbImage ? newImage() :
                main.tagName.toLowerCase() == 'img' ? main :
                main.querySelector('img'))

            if (main.dataset.lbName) {
                img.dataset.lbName = main.dataset.lbName

                if (this.nameSections[main.dataset.lbName])
                    this.nameSections[main.dataset.lbName].push(img)
                else this.nameSections[main.dataset.lbName] = [img]
            }
            else this.nameDuds.push(img)

            this.click(main, () => {
                this.toggleOpen(true)
                this.selectImage(img)
            })
        }

        const images = document.getElementsByClassName('litebokz')
        for (let i = 0; i < images.length; i ++) {
            const main = images[i]
            loadImages(main)
        }

        // Iterate through every node & load new images
        const htmlChanges = new MutationObserver(mutations => {
            mutations.forEach(mutation => {
                mutation.addedNodes.forEach(node => {
                    if (node.nodeType != Node.ELEMENT_NODE) return

                    if (node.classList.contains('litebokz') ||
                        node.querySelector('.litebokz')) {
                        loadImages(node)
                    }
                })
            })
        })

        htmlChanges.observe(document.documentElement, {
            childList: true,
            subtree: true
        })
    }

    sanitize(str) {
        return str
        .replace(/[^a-z0-9]+/gi, '-') // keep alphanumeric
        .replace(/-+/g, '-') // collapse dashes
        .replace(/^-|-$/g, '') // trim ends
        .toLowerCase()
    }

    generate() {
        const host = document.createElement('div')
        document.documentElement.appendChild(host)

        const shadow = host.attachShadow({mode: 'open'})

        const FADE = '.5s cubic-bezier(.5, .5, 0, 1)'
        const SLIDE = '.5s cubic-bezier(1, 0, 0, 1)'
        const HOVER = '.1s cubic-bezier(.5, .5, 0, 1)'

        const litebokzMainStr = () => {
            let str = ''
            for (let i = 0; i < this.themes.length; i ++) {
                const col = this.themes[i]
                const start = '.'+this.makeThemeStart(i)

                str += `
                ${start} .litebokz-main {
                    color: hsl(0,0%,${col.light<50?100:0}%);

                    background-color: hsla(
                        ${col.hue},
                        ${col.saturate}%,
                        ${col.light-10}%,
                        0);
                }
                ${start}.litebokz-open .litebokz-main {
                    background-color: hsla(
                        ${col.hue},
                        ${col.saturate}%,
                        ${col.light-10}%,
                        ${col.alpha});
                }`
            }

            return str
        }

        const litebokzPanelsStr = () => {
            let str = ''
            for (let i = 0; i < this.themes.length; i ++) {
                const col = this.themes[i]
                const start = '.'+this.makeThemeStart(i)

                str += `
                ${start} .litebokz-header,
                ${start} .litebokz-footer {
                    background-color: hsla(
                        ${col.hue},
                        ${col.saturate}%,
                        ${col.light}%,
                        ${col.alpha});

                    border: 0px solid hsla(
                        ${col.hue},
                        ${col.saturate+10}%,
                        ${col.light+15}%,
                        ${col.alpha+.3})
                }`
            }

            return str
        }

        const litebokzButtonMainStr = () => {
            let str = ''
            for (let i = 0; i < this.themes.length; i ++) {
                const col = this.themes[i]
                const start = '.'+this.makeThemeStart(i)

                str += `
                ${start} .litebokz-header .litebokz-button:hover .litebokz-button-main {
                    background-color: hsla(
                        ${col.hue},
                        ${col.saturate}%,
                        ${col.light+(col.light<50?
                            20 : -20
                        )}%, .7)
                }`
            }

            return str
        }

        const litebokzSvgStr = () => {
            let str = ''
            for (let i = 0; i < this.themes.length; i ++) {
                const col = this.themes[i]
                const start = '.'+this.makeThemeStart(i)

                str += `
                ${start} .litebokz-header .litebokz-button svg,
                ${start} .litebokz-header .litebokz-button path {
                    stroke: hsl(0,0%,${col.light<50?100:0}%);
                }`
            }

            return str
        }

        const litebokzLogoStr = () => {
            let str = ''
            for (let i = 0; i < this.themes.length; i ++) {
                const col = this.themes[i]
                const start = '.'+this.makeThemeStart(i)

                str += `
                ${start} .litebokz-footer .litebokz-logo svg,
                ${start} .litebokz-footer .litebokz-logo path {
                    width: 100%;
                    height: 100%;
                    fill: hsla(
                        ${col.hue},
                        ${col.saturate}%,
                        ${col.light+(col.light<50?
                            40 : -40
                        )}%,
                        ${col.alpha*.5});
                }`
            }

            return str
        }

        const litebokzNavStr = () => {
            let str = ''
            for (let i = 0; i < this.themes.length; i ++) {
                const col = this.themes[i]
                const start = '.'+this.makeThemeStart(i)

                const isDark = col.light>70&&col.alpha>.8

                str += `
                ${start} .litebokz-nav-main svg,
                ${start} .litebokz-nav-main path {
                    stroke: hsl(0,0%,${isDark?0:100}%);
                    ${!isDark?'filter: drop-shadow(1px 1px 5px #0009)':''};
                }`
            }
            return str
        }

        const litebokzAllButtonsStr = () => {
            let str = ''
            for (let i = 0; i < this.tools.length; i ++) {
                const tool = this.tools[i]
                const path = this.toolIcons[tool] || ''

                str += path + '\n'
            }
            return str
        }

        const content = `<style>
            * {
                box-sizing: border-box;
                user-select: none;
            }

            .litebokz-hold {
                position: fixed;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                z-index: 9999;
                pointer-events: none;
            }

            .litebokz-hold.litebokz-open {
                pointer-events: all;
            }

            .litebokz-hold::before {
                content: '';
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                opacity: 0;
                backdrop-filter: blur(10vw);
                transition: ${FADE};
                pointer-events: none;
            }

            .litebokz-hold.litebokz-open::before {
                opacity: 1;
            }

            .litebokz-main {
                position: relative;
                display: flex;
                flex-direction: column;
                width: 100%;
                height: 100%;
                transition: ${FADE};
            }

            ${litebokzMainStr()}

            .litebokz-header-hold {
                width: 100%;
                height: 50px;
                flex: 1 0 auto;
            }

            .litebokz-footer-hold {
                width: 100%;
                height: 50px;
                flex: 1 0 auto;
                ${!this.settings.hasFooter ? 'display: none;' : ''}
            }

            .litebokz-header,
            .litebokz-footer {
                display: flex;
                gap: 10px;
                position: relative;
                z-index: 1;
                flex: 1 0 auto;
                width: 100%;
                height: 100%;
                transition: ${FADE}, transform ${SLIDE};
                align-items: center;
            }

            ${litebokzPanelsStr()}

            .litebokz-header {
                transform: translateY(-100%);
                border-bottom-width: 1px !important
            }
            .litebokz-footer {
                transform: translateY(100%);
                border-top-width: 1px !important;
            }

            .litebokz-open .litebokz-header,
            .litebokz-open .litebokz-footer {transform: translateY(0)}

            .litebokz-header.litebokz-panel-hidden {transform: translateY(-100%)}
            .litebokz-footer.litebokz-panel-hidden {transform: translateY(100%)}

            .litebokz-display-hold {
                position: relative;
                flex: 1 1 auto;
                height: 100%;
            }

            .litebokz-display {
                height: 100%
            }

            /* -- image -- */
            .litebokz-img-holder {
                height: 100%;
                transform: scale(1);
            }

            .litebokz-display .litebokz-img {
                position: absolute;
                top: 50%;
                left: 50%;
                width: auto;
                height: auto;
                max-width: calc(100% - 30px);
                max-height: calc(100% - 30px);
                border-radius: 5px;
                box-shadow: 2px 2px 5px #0004;
                opacity: 0;
                transform: translate(-50%, -50%) scale(.9);
                ${this.settings.blurOnExit?'filter: blur(.2vw)':''};
                transition: transform ${FADE}, opacity ${FADE};
                cursor: grab;
                image-rendering: auto;
            }

            .litebokz-img.crisp {
                image-rendering: crisp-edges
            }

            .litebokz-img:active {
                cursor: grabbing
            }

            /* --- Switch images --- */
            .litebokz-open .litebokz-img {
                opacity: 1;
                transform: translate(-50%, -50%);
                filter: blur(0);
                z-index: 1;
            }

            .litebokz-open .litebokz-img.left {
                opacity: 0;
                transform: translate(-100%, -50%) scale(.7);
                z-index: 0;
            }
            .litebokz-open .litebokz-img.right {
                opacity: 0;
                transform: translate(0%, -50%) scale(.7);
                z-index: 0;
            }

            .litebokz-header-right {
                margin-left: auto;
                margin-right: 0;
                height: 100%;
                display: flex;
                align-items: center;
            }

            /* Normal button */
            .litebokz-button {
                width: 100%;
                height: 100%;
                background-color: transparent;
                border: none;
                padding: 4px 6px;
                cursor: pointer;
                display: flex;
                justify-content: center;
                pointer-events: all
            }

            .litebokz-button.disable {
                pointer-events: none
            }

            .litebokz-header .litebokz-button .litebokz-button-main {
                position: relative;
                width: auto;
                height: 100%;
                aspect-ratio: 1;
                border-radius: 20%;
                transform: scale(1);
                transition: ${HOVER};
                overflow: hidden;
            }

            ${litebokzButtonMainStr()}

            .litebokz-header .litebokz-button:active .litebokz-button-main {
                transform: scale(.8)
            }

            .litebokz-header .litebokz-button svg,
            .litebokz-header .litebokz-button path {
                position: relative;
                z-index: 1;
                width: 27px;
                height: 100%;
                fill: none;
                stroke-width: .15;
                stroke-linecap: round;
                stroke-linejoin: round;
                transition: ${FADE}
            }

            ${litebokzSvgStr()}

            .litebokz-header .litebokz-button.disable svg,
            .litebokz-header .litebokz-button.disable path {
                opacity: .5
            }

            /* Logo */
            .litebokz-footer .litebokz-logo {
                flex: 0 0 auto;
                margin-left: auto;
                margin-right: 0;
                height: 100%;
                padding: 5px;
                ${!this.settings.hasWordmark ? 'display: none;' : ''};
            }

            .litebokz-footer .litebokz-logo svg,
            .litebokz-footer .litebokz-logo path {
                width: 100%;
                height: 100%;
                transition: ${FADE}
            }

            ${litebokzLogoStr()}

            .litebokz-left {
                padding-left: 10px;
                height: fit-content;
                font-weight: 100;
                font-size: 18px;
                align-self: center;

                display: -webkit-box;
                -webkit-box-orient: vertical;
                -webkit-line-clamp: 2;
                line-clamp: 2;
                overflow: hidden;
                white-space: normal;
                text-overflow: ellipsis;
            }

            .litebokz-nav {
                position: absolute;
                top: 50%;
                width: 50px;
                height: 100%;
                border: none;
                background: transparent;
                cursor: pointer;
                transition: ${FADE};
                opacity: 0;
                padding: 0;
                transform: translateY(-50%);
            }

            .litebokz-nav-left {
                left: 0;
                transform: translate(-100%, -50%);
            }
            .litebokz-nav-right {
                right: 0;
                transform: translate(100%, -50%);
            }

            /* Visible Navigation Arrows */
            .litebokz-open .litebokz-nav {
                transform: translateY(-50%);
                opacity: 1;
                pointer-events: all;
            }

            /* Hidden Navigation Arrows */
            .litebokz-open .litebokz-nav.hidden {
                pointer-events: none;
            }

            .litebokz-nav-main {
                width: 100%;
                height: 100%;
                display: flex;
                align-items: center;
                justify-content: center;
                transform: scale(1);
                opacity: 1;
                transition: ${HOVER}
            }

            .litebokz-open .litebokz-nav-main:active {
                transform: scale(.8)
            }
            .litebokz-open .litebokz-nav.hidden .litebokz-nav-main {
                transform: scale(.5);
                opacity: 0;
            }

            .litebokz-nav-main svg,
            .litebokz-nav-main path {
                stroke-width: .15;
                fill: none;
                stroke-linecap: round;
                stroke-linejoin: round;
                transition: ${FADE};
            }

            ${litebokzNavStr()}

            @media screen and (max-width: 500px) {
                .litebokz-logo {
                    display: none;
                }
                .litebokz-left {
                    font-size: 15px;
                }
                .litebokz-header-right {
                    width: 100%
                }
                .litebokz-button {
                    min-width: 0;
                    padding: 4px 0;
                }
            }
        </style>

        <div class = "litebokz-hold">
            <div class = "litebokz-main">
                <div class = "litebokz-header-hold">
                    <div class = "litebokz-header">
                        <div class = "litebokz-header-right">
                            ${litebokzAllButtonsStr()}
                        </div>
                    </div>
                </div>
                <div class = "litebokz-display-hold">
                    <div class = "litebokz-display">
                        <div class = "litebokz-img-holder">
                            <img draggable = "false" id = "litebokz-img-1" class = "litebokz-img" src = "${this.placeholder}">
                            <img draggable = "false" id = "litebokz-img-2" class = "litebokz-img" src = "${this.placeholder}">
                            <img draggable = "false" id = "litebokz-img-3" class = "litebokz-img" src = "${this.placeholder}">
                        </div>
                    </div>
                    <button class = "litebokz-nav-left litebokz-nav">
                        <div class = "litebokz-nav-main">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                                <path d="M 1.7 1.1 L 1.3 1.5 L 1.7 1.9" stroke="#000" stroke-width=".1" fill="none"/>
                            </svg>
                        </div>
                    </button>
                    <button class = "litebokz-nav-right litebokz-nav">
                        <div class = "litebokz-nav-main">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0.75 0.75 1.5 1.5">
                                <path d="M 1.3 1.1 L 1.7 1.5 L 1.3 1.9" stroke="#000" stroke-width=".1" fill="none"/>
                            </svg>
                        </div>
                    </button>
                </div>
                <div class = "litebokz-footer-hold">
                    <div class = "litebokz-footer">
                        <div class = "litebokz-left">
                            <div id = "litebokz-text"></div>
                        </div>
                        <div class = "litebokz-logo">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="1 0.6 69.1 12.65">
                                <path d="M 1 1 L 1 10.8 C 1 13.6 4.4 13.7 6.1 12.6 L 6.3 10.4 C 5.7 10.6 5 10.5 5 9.5 L 5 1 Z M 6.9 4.4 L 6.9 13 L 10.9 13 L 10.9 4.4 Z M 9.7 0.6 C 11.5 0.6 11.5 3.8 9.7 3.8 L 8.1 3.8 C 6.4 3.8 6.3 0.6 8.1 0.6 Z M 11.6 7 L 11.6 4.4 L 12.9 4.4 L 12.9 2.6 L 16.9 1.5 L 16.9 4.4 L 19 4.4 L 19 7 L 16.9 7 L 16.9 10 C 16.9 10.9 18.5 10.7 19 10.3 L 19.2 12.5 C 16 14.1 13 12.9 13 10.5 L 13 7 Z M 23.5 9.5 L 28.8 9.5 C 30 5.9 26.2 3.2 22.8 4.4 S 19.2 8.6 20 10.5 S 22.4 13 23.7 13.1 S 25.8 13.1 26.8 12.7 S 28.5 11.3 28.8 10.7 L 25.7 9.8 C 25 11 23.5 10.5 23.5 9.5 M 23.4 8 C 23.4 6.4 25.3 6.4 25.3 8 Z M 29.9 1 L 29.9 13 L 33.4 13 L 33.5 11.1 C 34.3 13.6 37.8 13.8 39 11.5 S 39.7 4.9 37.4 4.4 S 34.2 5 33.9 5.8 L 33.9 1 Z M 33.9 8.7 C 33.9 8 34 7 34.8 7 S 35.7 8 35.7 8.7 S 35.6 10.4 34.8 10.4 S 33.9 9.4 33.9 8.7 M 40.4 8.6 C 40.4 2.6 50 2.6 50 8.6 S 40.4 14.6 40.4 8.6 M 44.3 8.7 C 44.3 9.5 44.5 10.5 45.2 10.5 S 46.1 9.4 46.1 8.7 S 46 6.8 45.2 6.8 S 44.3 8 44.3 8.7 M 51 1 L 51 13 L 55 13 L 55 11.3 L 56.1 10 L 57.7 13 L 62 13 L 58.7 7.8 L 61.8 4.4 L 57.5 4.4 L 55 7.4 L 55 1 Z M 62.1 4.4 L 62.1 6.9 L 65.5 6.9 L 62.1 10.7 L 62.1 13 L 70.1 13 L 70.1 10.3 L 66.6 10.3 L 69.9 6.6 L 69.9 4.4 Z"/>
                            </svg>
                        </div>
                    </div>
                </div>
            </div>
        </div>`

        shadow.innerHTML = content

        host.style.fontFamily = 'Arial, monospace'
    
        const work = new FontFace('WorkSans', `url(data:${this.font.mime};base64,${this.font.base64}) format('${this.font.format}')`)
        work.load().then(font => {
            document.fonts.add(font)
            host.style.fontFamily = '"WorkSans", Arial, monospace'
        })

        // -- Main elements --
        this.holder = shadow.querySelector('.litebokz-hold')
        this.main = shadow.querySelector('.litebokz-main')
        this.header = shadow.querySelector('.litebokz-header')
        this.footer = shadow.querySelector('.litebokz-footer')
        this.display = shadow.querySelector('.litebokz-display')

        this.headerHold = shadow.querySelector('.litebokz-header-hold')
        this.footerHold = shadow.querySelector('.litebokz-footer-hold')
        this.displayHold = shadow.querySelector('.litebokz-display-hold')

        this.navLeft = shadow.querySelector('.litebokz-nav-left')
        this.navRight = shadow.querySelector('.litebokz-nav-right')

        this.text = shadow.getElementById('litebokz-text')

        if (this.settings.tapToHidePanels) {
            this.click(this.headerHold, () => {if (!this.panelVisible) this.togglePanels(true)})
            this.click(this.footerHold, () => {if (!this.panelVisible) this.togglePanels(true)})
            this.click(this.display, () => this.togglePanels())
        }

        if (this.settings.tapAwayToClose) {
            this.click(this.display, e => {
                if (e.target && e.target != this.image) this.close()
            })
        }

        // -- Buttons --
        this.minusBtn = shadow.getElementById('litebokz-minus')
        this.plusBtn = shadow.getElementById('litebokz-plus')
        const themeBtn = shadow.getElementById('litebokz-theme')
        const downloadBtn = shadow.getElementById('litebokz-download')
        this.fitBtn = shadow.getElementById('litebokz-fit')
        const fullscreenBtn = shadow.getElementById('litebokz-fullscreen')
        const closeBtn = shadow.getElementById('litebokz-close')

        const fullscreenPath = shadow.getElementById('litebokz-fullscreen-path')

        const updateSmooth = () => {
            // Cencel
            if (Math.abs(this.zoomSmooth) < .01) {
                this.zoomSmooth = 0
                this.zoomSmoothID = null
                return
            }

            // Get amount
            const multiply = this.settings.zoomIncrement * this.zoomSmooth

            // Apply
            this.zoom({
                clientX: innerWidth / 2,
                clientY: innerHeight / 2,
                deltaY: -multiply * this.scale
            })
            this.updateDisplay()

            // Prepare for next frame
            this.zoomSmooth *= .7
            this.zoomSmoothID = requestAnimationFrame(updateSmooth)
        }
        updateSmooth()

        this.click(this.minusBtn, (e) => {
            this.zoomSmooth = -1
            updateSmooth()
        })
        this.click(this.plusBtn, (e) => {
            this.zoomSmooth = 1
            updateSmooth()
        })
        this.click(themeBtn, () => {
            this.setTheme(this.selectedTheme + 1)
        })
        this.click(downloadBtn, () => {
            if (!this.image) return
            const alt = this.sanitize(this.text.textContent)

            const a = document.createElement('a')
            a.href = this.image.src
            a.download = `litebokz-${alt}.png`
            document.body.appendChild(a)
            a.click()
            document.body.removeChild(a)
        })
        this.click(this.fitBtn, () => {
            this.zoomAmt = 1
            this.camX = 0
            this.camY = 0
            this.fitBtn.classList.add('disable')
            this.updateDisplay()
        })
        this.click(fullscreenBtn, () => this.toggleFullscreen())
        this.click(closeBtn, () => this.close())

        // -- Image --
        this.imageHolder = shadow.querySelector('.litebokz-img-holder')

        this.image1 = shadow.getElementById('litebokz-img-1')
        this.image1.litebokzID = 1

        this.image2 = shadow.getElementById('litebokz-img-2')
        this.image2.litebokzID = 2

        this.image3 = shadow.getElementById('litebokz-img-3')
        this.image3.litebokzID = 3

        this.image = this.image1
        this.shadow = shadow

        // -- Details --
        addEventListener('fullscreenchange', () => {
            if (!fullscreenPath) return
            if (!!document.fullscreenElement) fullscreenPath.setAttribute('d', this.minIcon)
            else fullscreenPath.setAttribute('d',  this.fullIcon)
        })
    }
}

const litebokz = new LiteBokz()